import React, {Component} from 'react';

async function fetch_query(q)
    {
        let res

        res = await fetch(q)

        let results = res.json()
        console.log(results)
    }

class Listing extends Component {
    constructor(props) {
        super(props);
        this.state = { query : 'https://www.breakingbadapi.com/api/characters?limit=10' }
    }

    handleClick()
    {
        fetch_query(this.state.query)

    }

    render() { 

        return <button onClick = {() => handleClick()}>Find</button>;
    }
}
 
export default Listing;
